export class Employee{

    constructor(name:string, surname:string, charge:string, salary:number){
        this.name = name;
        this.surname = surname;
        this.charge = charge;
        this.salary = salary;
    }



    name:string='';
    surname:string='';
    charge:string='';
    salary:number=0;
}
